import React, { Component } from "react";

class UserBar extends Component {
  constructor(props) {
    super(props);
    this.state = { value: "" };
  }

  existingUserLogin = () => {
    this.props.parseUsernames();
    return (
      <div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
          }}
        >
          <h1>Log in or create account</h1>
        </div>

        <div
          style={{
            display: "flex",
            justifyContent: "center",
          }}
        >
          <form>
            <label>Username</label>
            <input type="text" name="username" onChange={this.props.logIn} />

            <label>Password</label>
            <input
              type="password"
              name="password"
              onChange={this.props.logIn}
            />
          </form>
        </div>
      </div>
    );
  };

  newUserSignup = () => {
    return (
        <div>
          <div
            style={{
              display: "flex",
              justifyContent: "center",
            }}
          >
            <h1>Log in or create account</h1>
          </div>

          <div
            style={{
              display: "flex",
              justifyContent: "center",
            }}
          >
            <form>
              <label>Username</label>
              <input type="text" name="username" />

              <label>Password</label>
              <input type="password" name="password" />
              <submit></submit>
            </form>
          </div>
        </div>
      );

  }

  render() {
    return (
      <div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
          }}
        >
          <h1>Log in or create account</h1>
        </div>

        <div
          style={{
            display: "flex",
            justifyContent: "center",
          }}
        >
          <form>
            <label>Username</label>
            <input type="text" name="username" onChange={this.props.logIn} />

            <label>Password</label>
            <input
              type="password"
              name="password"
              onChange={this.props.logIn}
            />
          </form>
        </div>
      </div>
    );
  }
}
export default UserBar;
